import React from "react";
import "./Tips.css";

const Tips = () => {
  return (
    <div className="tips-container">
      <h1>Productivity Tips</h1>
      <p>Maximize your efficiency with these quick tips and tricks:</p>
      <ul>
        <li>Break large tasks into smaller steps.</li>
        <li>Prioritize tasks using a daily to-do list.</li>
        <li>Set deadlines for each task.</li>
        <li>Take short breaks to stay focused.</li>
        <li>Review completed tasks to track progress.</li>
      </ul>
    </div>
  );
};

export default Tips;
